    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    and the easement refuges outlines Refuge accomplishments from January through April
    of 1962. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include grazing, fur harvesting, and timber removal. A progress report on
    field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    and violations. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
